<?php $__env->startSection('content'); ?><p>Kylie Jenner kept a very low profile in her first sighting since the shock cancellation of her family's reality show. </p>

<p>The youngest member of the Kardashian/Jenner clan seemed to be feeling camera shy as she covered her face while attending a TIK TOK party at 40 Love in Los Angeles on Wednesday. </p>

<p>The lip kit mogul, 23, also changed up her style for the party, sheathing her famous curves in a baggy top and jeans. </p>

<p>Camera shy? Kylie Jenner kept a very low profile in her first sighting since the shock cancellation of her family's reality show</p>

<p>Hiding her ample assets and tiny waist, the mother-of-one slipped into a khaki slogan T-shirt that she teamed with bleached bootleg jeans.</p>

<p>Injecting some glamour with her accessories, Kylie toted a cream Dior saddle bag and sported a myriad of silver bangles and rings. </p>

<p>She completed the look with a nude coloured face mask and sported a glossy chestnut wig that cascaded past her shoulders.  </p>

<p>Two's company: The youngest member of the Kardashian/Jenner clan seemed to be feeling camera shy attending a TIK TOK party with pal Zack Pia at 40 Love in LA on Wednesday</p>

<p>Stepping out: This marked Kylie's first sighting since the shock news Keeping Up With The Kardashians will be coming to an end next year. She is yet to comment publicly on the matter</p>

<p>Kylie's outing came after it was revealed that Keeping Up With The Kardashians will be coming to an end next year.</p>

<p>The series, which made the family household names, will conclude with its 20th season after 14 years on the air. </p>

<p>Kim Kardashian was the first member of the family to break the news, with a statement on Instagram, with the rest of her sisters following suit.   </p>

<p>Low-key: Hiding her ample assets and tiny waist, the mother-of-one slipped into a khaki slogan T-shirt that she teamed with bleached bootleg jeans</p>

<p>All about the accessories: Injecting some glamour with her accessories, Kylie toted a cream Dior saddle bag and sported a myriad of silver bangles and rings </p>

<p>The shocking announcement did not give a specific reason for pulling the plug of the reality show, but the Kardashian clan did take the time to thank their devout following for their support over the years. </p>

<p>Speculation has been rife over the reason for the shock cancellation, with the reports circulating it was due to the show's dwindling ratings but also as the family have been hit by personal struggles.</p>

<p>Kim's husband Kanye West, 43, suffered a very public breakdown and Kim reportedly refused to reference Kanye's episode on the show.</p>

<p>Kourtney also decided to take a step back to focus on motherhood. </p>

<p>It's over! Keeping Up With The Kardashians will wrap next year. The series, which made the family household names, will conclude with its 20th season after 14 years on the air</p>

<p>Kylie - who had her own spin-off show off the back of the series - has yet to acknowledge the news on social media. </p>

<p>Instead, the reality star spent the night on a fun family get-together as she tried to take a family photo with her squirmy two-year-old daughter Stormi and her ex Travis Scott, 28. </p>

<p>'pics with 2 year olds,' captioned Kylie, who had on a stunning all black ensemble as Travis smiled next to her. </p>

<p>Later, they joined her mother Kris Jenner, 64, for a movie in an IMAX theater that they appeared to have rented to themselves.</p>

